`,sr=n.p+"static/media/cruise.eb6a11ff8e03695b8354.jpg",ur=()=>(0,gn.jsxs)(nr,{id:"rejsy-po-jeziorze",children:[(0,gn.jsx)(rr,{className:"mobile-header",children:"Rejsy gondol\u0105 po jeziorze Czorszty\u0144skim"}),(0,gn.jsx)(ar,{children:(0,gn.jsxs)(or,{children:["Oferujemy jedyn\u0105 w swoim rodzaju i niepowtarzaln\u0105 mo\u017cliwo\u015b\u0107 rejsu gondolami pomi\u0119dzy naszymi przystaniami na dw\xf3ch trasach. Trasa \u0142\u0105cz\u0105ca ruiny zamk\xf3w w Czorsztynie i Niedzicy, kurs sta\u0142y, odbywa si\u0119 co 15 minut z Czorsztyna lub Niedzicy. To idealna okazja swobodnego zwiedzenia okolicy na obydwu brzegach Jeziora Czorszty\u0144skiego. Trasa dooko\u0142a Jeziora Czorszty\u0144skiego, rejs rusza z minimum 8 osobami na pok\u0142adzie gondoli, czas rejsu to oko\u0142o 40 minut, daje mo\u017cliwo\u015b\u0107 zapoznania si\u0119 z malowniczymi zatoczkami i pla\u017cami jeziora, rejsy odbywaj\u0105 si\u0119 po uzgodnieniu telefonicznym w godzinach porannych (9:00-10:00) popo\u0142udniowych (17:00-18:00) w sezonie (1 lipca -31 sierpnia). Nasze gondole \u201cCzorsztynianki\u201d kursuj\u0105 codziennie, od 1 maja do 30 wrze\u015bnia, w godzinach 9.00 \u2013 18.00 w sezonie (od 1 lipca do 31 sierpnia) oraz 10.00 \u2013 16.00 poza sezonem (od 1 maj do 30 czerwca, od 1 wrze\u015bnia do 30 wrze\u015bnia). Dysponujemy 6 gondolami, kt\xf3re jednorazowo mog\u0105 zabra\u0107 72 osoby. Na gondolach mo\u017cna przewozi\u0107 rowery, zwierz\u0119ta s\u0105 mile widziane.",(0,gn.jsx)("br",{}),"Po rejsie zapraszamy do naszej przystani. Przysta\u0144 J\u0119dru\u015b w Czorsztynie oferuje wiele mo\u017cliwo\u015bci sp\u0119dzenia czasu nad urokliwym Jeziorem Czorszty\u0144skim. W Przystani znajduje si\u0119 tak\u017ce ma\u0142a gastronomia, gdzie mo\u017cna zakupi\u0107 zimne i ciep\u0142e napoje, przek\u0105ski, lody, s\u0142odycze. Do dyspozycji go\u015bci oddajemy ogr\xf3dek z \u0142awkami, parasolami chroni\u0105cymi przed s\u0142o\u0144cem i deszczem, wygodne pufy i le\u017caki oraz hamaki w zacienionym zagajniku."]})}),(0,gn.jsxs)(lr,{children:[(0,gn.jsx)(ir,{src:sr,alt:"Zdj\u0119cie rejsu"}),(0,gn.jsx)(rr,{className:"desktop-header",children:"Rejsy gondol\u0105 po jeziorze Czorszty\u0144skim"})]})]}),cr=Vt.table`
